import {DAppProvider, Config, ChainId} from "@usedapp/core";
import {Header} from "./components/Header";

const config: Config = {
  supportedChains: [ChainId.Kovan]
}

function App() {
  return (
    <DAppProvider config={config}>
      <Header/>
    </DAppProvider>
  );
}

export default App;
